public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (!(obj instanceof ReservationInterval)) {
    return false;
  }
  ReservationInterval other = (ReservationInterval) obj;
  if (endTime != other.endTime) {
    return false;
  }
  if (startTime != other.startTime) {
    return false;
  }
  return true;
}
